import { VegaColors } from "./types";

const brand = {
  brandBlack: "#000",
  brandBlue: "#0032EB",
  brandDarkBlue: "#000F46",
  brandWhite: "#FFF",
  brandYellow: "#FFF001",
};

const alert = {
  alertGreen: "#05944F",
  alertRed: "#E11900",
  alertYellow: "#FFC043",
};

const legacy = {
  legacyGreen: "#00F48F",
  legacyRed: "#F04141",
};

const brandBlue = {
  brandBlue100: "#E6EBFD",
  brandBlue200: "#CCD6FB",
  brandBlue300: "#99ADF7",
  brandBlue400: "#6684F3",
  brandBlue500: "#335BEF",
  brandBlue600: brand.brandBlue,
  brandBlue700: "#0018EB",
  brandBlue800: "#0013C0",
  brandBlue900: "#000F95",
  brandBlue1000: "#000B71",
  brandBlue1100: "#000F46",
};

const brandYellow = {
  brandYellow100: "#FFFDD8",
  brandYellow200: "#FFFBB5",
  brandYellow300: "#FFF669",
  brandYellow400: brand.brandYellow,
  brandYellow500: "#F8DF03",
  brandYellow600: "#ECC600",
  brandYellow700: "#D8A800",
  brandYellow800: "#AF8900",
  brandYellow900: "#8E6F00",
};

const neutral = {
  neutral100: "#FBFBFB",
  neutral200: "#F3F3F3",
  neutral300: "#E5E5E5",
  neutral400: "#CCC",
  neutral500: "#B2B2B2",
  neutral600: "#999",
  neutral700: "#808080",
  neutral800: "#666",
  neutral900: "#4C4C4C",
  neutral1000: "#333",
  neutral1100: "#171717",
};

const background = {
  backgroundWhite100: neutral.neutral100,
  backgroundWhite200: neutral.neutral200,
  backgroundWhite300: neutral.neutral300,
};

const alertGreen = {
  alertGreen100: "#E6F2ED",
  alertGreen200: "#ADDEC9",
  alertGreen300: "#66D19E",
  alertGreen400: "#06C167",
  alertGreen500: alert.alertGreen,
  alertGreen600: "#03703C",
  alertGreen700: "#03582F",
  alertGreen800: "#10462D",
};

const alertYellow = {
  alertYellow100: "#FFFAF0",
  alertYellow200: "#FFF2D9",
  alertYellow300: "#FFE3AC",
  alertYellow400: "#FFCF70",
  alertYellow500: alert.alertYellow,
  alertYellow600: "#BC8B2C",
  alertYellow700: "#997328",
  alertYellow800: "#674D1B",
};

const alertRed = {
  alertRed100: "#FFEFED",
  alertRed200: "#FED7D2",
  alertRed300: "#F1998E",
  alertRed400: "#E85C4A",
  alertRed500: alert.alertRed,
  alertRed600: "#AB1300",
  alertRed700: "#870F00",
  alertRed800: "#5A0A00",
};

const creditCard = {
  creditCardBlack: neutral.neutral1100,
};

const gradients = {
  gradientBlackBlue:
    "linear-gradient(108.01deg, #171717 0.61%, #171717 0.62%, #0032EB 101.94%)",
};

const currencies = {
  coinUsd: "#5F9341",
  coinBtc: "#FF7E30",
  coinEth: "#846DF3",
  coinGusd: "#03C9E8",
  coinLtc: "#B0AFAF",
  coinPax: "#41A97F",
  coinPaxg: "#B98D00",
  coinUsdc: "#007BFF",
  coinUsdt: "#5AC3A6",
  coinDai: "#FFA843",
  coinBusd: "#F4CB49",
  coinLink: "#0019FF",
  coinAlgo: "#000",
  coinUni: "#FF007A",
  coinBat: "#FF4724",
};

const colors: VegaColors = {
  ...brand,
  ...alert,
  ...brandBlue,
  ...brandYellow,
  ...neutral,
  ...background,
  ...alertGreen,
  ...alertYellow,
  ...alertRed,
  ...currencies,
  ...creditCard,
  ...gradients,
  ...legacy,
  transparent: "trasparent",
};

export default colors;
